import React,{Component} from 'react';
import './App.scss';
import Menu from './Menu'
class App extends Component{
  menuClick = (e) =>{
    e.target.classList.toggle('close')

  }
  render(){

    return(
     <React.Fragment>
        <div className="menu-btn" id="btn" onClick={this.menuClick}>
            <div className="menu-btn-line"></div>
            <div className="menu-btn-line"></div>
            <div className="menu-btn-line"></div>
        </div>
        <Menu />
     </React.Fragment>
    )
  }
}
export default App;
